  `CUSTOMER_EMAIL` varchar(50) DEFAULT NULL,
  `CUSTOMER_ADHAR_NO` varchar(50) DEFAULT NULL,
  `CUSTOMER_DISTRICT` int(11) DEFAULT NULL,
