  CONSTRAINT `customermaster_ibfk_2` FOREIGN KEY (`CUSTOMER_CITY`) REFERENCES `areas` (`AREA_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=864 DEFAULT CHARSET=utf8mb4;

