) ENGINE=InnoDB AUTO_INCREMENT=3427 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `login` (
  `LOGINID` int(11) NOT NULL AUTO_INCREMENT,
  `USERNAME` varchar(30) DEFAULT NULL,
  `USER_PASSWORD` varchar(250) DEFAULT NULL,
  `USER_LEVEL` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`LOGINID`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `orderItemMaster` (
  `OR_IT_ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `OR_TO_LN_ID` bigint(20) DEFAULT NULL COMMENT 'THIS ORDER ITEM IS BELONGS TO',
  `OR_OF_CUS` bigint(20) DEFAULT NULL,
  `OR_OF_PR_ID` bigint(20) DEFAULT NULL,
  `OR_OF_PR_QUANTITY` bigint(20) DEFAULT NULL,
  `OR_BILL_STATUS` int(11) DEFAULT 1 COMMENT 'THIS SHOWS THE ORDER ITEMS OF CURRENT BILL',
  PRIMARY KEY (`OR_IT_ID`),
  KEY `OR_OF_CUS` (`OR_OF_CUS`),
  KEY `OR_OF_PR_ID` (`OR_OF_PR_ID`),
  KEY `OR_TO_LN_ID` (`OR_TO_LN_ID`),
  CONSTRAINT `orderItemMaster_ibfk_1` FOREIGN KEY (`OR_OF_CUS`) REFERENCES `customermaster` (`CUSTOMER_ID`),
  CONSTRAINT `orderItemMaster_ibfk_2` FOREIGN KEY (`OR_OF_PR_ID`) REFERENCES `products` (`PRODUCT_ID`),
  CONSTRAINT `orderItemMaster_ibfk_3` FOREIGN KEY (`OR_TO_LN_ID`) REFERENCES `loanMaster` (`LOAN_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=315 DEFAULT CHARSET=latin1;




CREATE TABLE `products` (
  `PRODUCT_ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `PRODUCT_NAME` varchar(50) DEFAULT NULL,
  `PRODUCT_BRAND` int(11) DEFAULT NULL,
  `PRODUCT_MODEL_NO` varchar(50) DEFAULT NULL,
  `PRODUCT_PRICE` bigint(20) DEFAULT NULL,
  `PRODUCT_QUANTITY` bigint(20) DEFAULT NULL,
  `PRODUCT_STATUS` int(11) DEFAULT 1 COMMENT 'TO VIEW THE STATUS OF PRODUCT',
  `PRODUCT_CREATED` date DEFAULT NULL,
  PRIMARY KEY (`PRODUCT_ID`),
  KEY `PRODUCT_BRAND` (`PRODUCT_BRAND`)
) ENGINE=InnoDB AUTO_INCREMENT=44 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `sales` (
  `SALE_ID` bigint(20) NOT NULL AUTO_INCREMENT,
